<head>
  <meta charset="UTF-8" />

  <title>Vicarex - Because You Care</title>
  <style>
    body {
      font-family: Arial, sans-serif;
      background-color: #f9fdf9;
      color: #333;
      margin: 0;
      padding: 0;
    }
    header {
      text-align: center;
      padding: 30px 20px 10px;
      background: #fff;
    }
    header img {
      width: 180px;
      height: auto;
    }
    h1 {
      font-size: 2.2em;
      margin: 10px 0 5px;
    }
    .slogan {
      color: #4CAF50;
      font-size: 1.2em;
    }
    .products {
      display: grid;
      grid-template-columns: repeat(auto-fit, minmax(240px, 1fr));
      gap: 20px;
      padding: 40px 20px;
      background-color: #eef9ee;
    }
    .product {
      background: #fff;
      border-radius: 10px;
      box-shadow: 0 2px 5px rgba(0,0,0,0.1);
      overflow: hidden;
    }
    .product img {
      width: 100%;
      height: 180px;
      object-fit: cover;
    }
    .product h3 {
      padding: 10px;
      margin: 0;
    }
    .contact {
      padding: 30px 20px;
      background: #fff;
      text-align: center;
    }
    .contact p {
      font-size: 1.1em;
      margin: 8px 0;
    }
    footer {
      background-color: #d2ecd2;
      padding: 10px;
      text-align: center;
      font-size: 0.9em;
    }
  </style>
